# Apaga todos os alunos e zera o contador de IDs
ActiveRecord::Base.transaction do
  Aluno.delete_all

  conn = ActiveRecord::Base.connection
  if conn.respond_to?(:reset_pk_sequence!)
    conn.reset_pk_sequence!('alunos') # PostgreSQL/SQLite
  end
end
alunos_csv.each do |id, nome, username, password, escola_id, escola_nome|
  escola = Escola.find_or_create_by!(id: escola_id.to_i, instituica_id: 1) do |e|
    e.nome = escola_nome
  end
  serie = Serieano.find_or_create_by!(nome: "9º Ano", escola: escola)
  aluno = Aluno.find_or_initialize_by(username: username)
  aluno.assign_attributes(email: "#{username}@sysquiz.com", nome: nome, instituica_id: 1, escola_id: escola.id, serieano_id: serie.id)
  aluno.password = password
  aluno.password_confirmation = password
  aluno.save!
end
